	add("yarl", "{\"term\":\"yarl\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Presumably onomatopoeic. Coined by Josh Sinder and Alex Sibbald of the band [http://www.myspace.com/hotrodlunaticsmusic Hot Rod Lunatics].\u0026lt;ref\u0026gt;Jack Endino, \u0026quot;[http://www.endino.com/archive/yarl.html Verb of the Month: \u0027To Yarl\u0027]\u0026quot;, \u0027Backfire\u0027, Summer 2000 issue\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A deep, guttural vocal style with affected pronunciation, characteristic of male grunge and postgrunge singers of the 1990s and early 2000s\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Patrick Berkery, \u0026quot;[http://clatl.com/atlanta/record-review/Content?oid\u003d1235164 Record Review]\u0026quot;, \u0027Creative Loafing\u0027 (Atlanta), 9 January 2002\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"So pontificating on how \u0027Weathered\u0027\u0027s earnest morass of block-headed rage, grunge-lite mega-riffs and singer Scott Stapp\u0027s machismo \u0027\u0027yarl\u0027\u0027 amounts to little more than Pearl Jam circa \u002791 for dummies is like shooting fish in a barrel\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Michael J. Vaughn, \u0027Outro\u0027, iUniverse (2008), ISBN 9781440111402, [http://books.google.com/books?id\u003dtYak_STNXxcC\u0026amp;pg\u003dPA10 page 10\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"One of my college kids informed me that the latest acoustic grinder hunk had covered it for a soundtrack — probably with that grungy \u0027\u0027yarl\u0027\u0027 that everybody ripped off from Eddie Vedder\", \"priority\":5}]}, \"synonyms\":{}}");

